const getDog = async (breedId) => {


    const url = "http://localhost:8000/showAPI";
    const res = await fetch(url);
    const response = await res.json();
    
    const procura = (breedId) => response.id === breedId;
    const data = response.find((breedId) => response.id === breedId);
    console.log(data(breedId))

    const dog = {
	image: data.image_url,
	breed: {
		id: data.id,
		name: data.name,
	    }
    }
    return dog
}

export default getDog;
